import React from "react";
import "Navbar.css"
export default function Navbar() {
  return (
    <>
      <nav>
        <h1>BrainyLingo</h1>

        <ul>
          <li>Home</li>
          <li>Leaderboard</li>
          <li>Daily Quiz</li>
          <li>Genre</li>
        </ul>

        <button>Sign Out</button>
      </nav>
    </>
  );
}
